import React from "react";
import PosItem from "./PostItem";

const PostList = ({posts}) => {
    return (
        <div>

        <h1 style={{textAlign: 'center'}}>Список постов</h1>
            {posts.map((post) => 
        <PosItem post={post} key={post.id}/>
      )}
        </div>
    )
}

export default PostList;
